  true,\n\t\"url\": null,\n\t\"notes\": \"The Campus Safety and Security Survey, 2013
  (CSSS 2013), is a data collection that is part of the Campus Safety and Security
  Survey (CSSS) program; program data is available since 2005 at <http://ope.ed.gov/security/GetDownloadFile.aspx>.
  CSSS 2013 (http://ope.ed.gov/security/) was a cross-sectional survey that collected
  information required for benefits about crime, criminal activity, and fire safety
  at postsecondary institutions in the United States. The collection was conducted
  through a web-based data entry system utilized by postsecondary institutions. All
  postsecondary institutions participating in Title IV funding were sampled. The collection's
  response rate was 100 percent. Key statistics produced from CSSS 2013 were on the
  number and types of crimes committed at responding postsecondary institutions and
  the number of fires on institution property.\",\n\t\"license_title\": \"Creative
